window.bookSummaryJSON = "<p>Cricket is used to relying on no one but herself. Working two jobs to get through nursing school, she has no time for anything but studying and paying the bills. When three hot cowboys give her a night to remember, she believes it’s just that. One night.&nbsp;</p> <p>For Sutton, Archer, and Lee, Cricket’s the one who got away. Hell, she’s <i>the</i> one. Period. When fate puts her back in their arms, they’ll stop at nothing to keep her.&nbsp;</p> <p>If you like hot cowboys, you (and Cricket) get three in this one. They’re hot, they know exactly what they want, and nothing will stand in their way.</p>"; 
